import './home.less'
import  memoryUtil  from '../../utils/memoryUtil'
import { Redirect } from 'react-router-dom';
import { Layout } from 'antd';
import SideNav from '../../components/SideNav';

const { Header, Footer, Sider, Content } = Layout;
export default function Home(props) {
    const user = memoryUtil.user;
    if (!user || !user._id) return <Redirect to="/login" />
        
    return (
      
        <Layout className='layout'>
      <Sider className='sider' width="4rem" style={{backgroundColor:'transparent'}}  >
          <SideNav />
      </Sider>
      <Layout>
        <Header style={{backgroundColor:'#E7EAED'}} >Header</Header>
        <Content style={{backgroundColor:'white'}}>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    )

}
